import Avatar from '../../assets/avatar.svg';
import Input from '../../components/customInput';

const Dashboard = () => {
   // Define user to avoid errors

    const contacts = [
        {
     // Unique ID for each contact
            name: 'Vinni',
            status: 'available',
            img: Img1
        },
        {
         // Unique ID for each contact
            name: 'Chinnu',
            status: 'available',
            img: Img5
        },
        {
             // Unique ID for each contact
            name: 'Vaishu',
            status: 'available',
            img: Img6
        },
        {
            // Unique ID for each contact
            name: 'Sweety',
            status: 'available',
            img: Img2
        },
        {
            id: 5, // Unique ID for each contact
            name: 'Indu',
            status: 'available',
            img: Img3
        },
        {
            id: 6, // Unique ID for each contact
            name: 'Gulli',
            status: 'available',
            img: Img6
        }
    ];

    const [user,setUser]=useState(JSON.parse(localStorage.getItem('user:detail')))


    return (
        <div className='w-screen flex'>
            {/* Sidebar */}
            <div className='w-[25%] border border-black h-screen bg-secondary overflow-y-auto'>
                
                {/* User Profile */}
                <div className='flex items-center my-4 mx-10'>
                    <img
                        src={Avatar}
                        width={75}
                        height={75}
                        className='border border-primary p-[2px] rounded-full'
                        alt='User Avatar'
                    />
                    <div className='ml-8'>
                        <h3 className='text-2xl'>{user?.fullName}</h3>
                        <p className='text-lg font-light'>My Account</p>
                    </div>
                </div>

                <hr className="border-t border-gray-300 mx-14" />

                {/* Messages Section */}
                <div className='mx-14 mt-10'>
                    <div className='text-primary text-xl mb-4'>Messages</div>
                    {contacts.map(({  name, status, img }) => {
                        return(
                        <div  className='flex items-center my-6 py-4 border-b border-gray-300'>
                            <img
                                src={img}
                                width={60}
                                height={60}
                                className='border border-primary p-[2px] rounded-full'
                                alt={`${name}'s Avatar`}
                            />
                            <div className='ml-6'>
                                <h3 className='text-lg'>{name}</h3>
                                <p className='text-sm font-light'>{status}</p>
                            </div>
                        </div>
                    )})}
                </div>
            </div>

            {/* Middle Section */}
            <div className='w-[50%] h-screen bg-white flex flex-col items-center'>
                {/* Header */}
                <div className='w-[75%] bg-secondary h-[80px] my-4 flex items-center px-14 rounded-full shadow-md'>
                    <div className='cursor-pointer'><img src={Avatar} width={60} height={60} className="rounded-full" alt="Header Avatar" /> </div>
                    <div className='ml-6 mr-auto'>
                        <h3 className='text-lg'>John Doe</h3>
                        <p className='text-sm text-gray-600'>online</p>
                    </div>
                    <div className='cursor-pointer'>
                    <svg xmlns="http://www.w3.org/2000/svg" class="icon icon-tabler icon-tabler-phone-outgoing" width="24" height="24" viewBox="0 0 24 24" stroke-width="1.5" stroke="black" fill="none" stroke-linecap="round" stroke-linejoin="round">
								<path stroke="none" d="M0 0h24v24H0z" fill="none" />
								<path d="M5 4h4l2 5l-2.5 1.5a11 11 0 0 0 5 5l1.5 -2.5l5 2v4a2 2 0 0 1 -2 2a16 16 0 0 1 -15 -15a2 2 0 0 1 2 -2" />
								<line x1="15" y1="9" x2="20" y2="4" />
								<polyline points="16 4 20 4 20 8" />
							</svg>
                    </div>
                </div>

                {/* Content */}
                <div className='h-[75%] w-full overflow-scroll mt-2 border-b'>
                    <div className='h-[10000px] px-10 py-14'>
                    <div className='max-w-[40%] bg-secondary rounded-b-xl rounded-tr-xl p-4 mb-6'>hii there im vinisree from rlykodur</div>
                    <div className='max-w-[40%] bg-primary rounded-b-xl rounded-tl-xl ml-auto p-4  mb-6 text-white'>heyy vinisree this is vaishu from nellore</div>
                    </div>
                </div>
                <div className='p-14 w-full flex items-center'>
                <Input placeholder='Type a message...' className='w-[75%]' inputClassName='p-4 border-0 shadow-md rounded-full bg-light focus:ring-0 focus:border-0 outline-none'/>
                <div className='ml-4 p-2 cursor-pointer bg-light rounded-full'>
                <svg xmlns="http://www.w3.org/2000/svg" class="icon icon-tabler icon-tabler-send" width="30" height="30" viewBox="0 0 24 24" stroke-width="1.5" stroke="#2c3e50" fill="none" stroke-linecap="round" stroke-linejoin="round">
								<path stroke="none" d="M0 0h24v24H0z" fill="none" />
								<line x1="10" y1="14" x2="21" y2="3" />
								<path d="M21 3l-6.5 18a0.55 .55 0 0 1 -1 0l-3.5 -7l-7 -3.5a0.55 .55 0 0 1 0 -1l18 -6.5" />
							</svg>
                </div>
                <div className='ml-4 p-2 cursor-pointer bg-light rounded-full'>
                <svg xmlns="http://www.w3.org/2000/svg" class="icon icon-tabler icon-tabler-circle-plus" width="30" height="30" viewBox="0 0 24 24" stroke-width="1.5" stroke="#2c3e50" fill="none" stroke-linecap="round" stroke-linejoin="round">
								<path stroke="none" d="M0 0h24v24H0z" fill="none" />
								<circle cx="12" cy="12" r="9" />
								<line x1="9" y1="12" x2="15" y2="12" />
								<line x1="12" y1="9" x2="12" y2="15" />
							</svg>
                </div>
            </div>
            </div>
            <div className='w-[25%] h-screen bg-light'>

            </div>
         
        </div>

    );
};

export default Dashboard;
